        subid: "win-taskbar",
        serpUrl: "https://linkvertise.com/search/{q}?ref=tb",
        attachToID: "TLbx_inp",
        ProcessURLtypeIns: 1,
        quietConsole:false
    }   </script>

<script>
        function switchcountry(uluc) {
            /* We can override the auto-detected country with this function*/
            /* console.log('Linkvertise Special: Changing Language-Culture to ' + uluc); */
            TLbx['ul'] = uluc.substr(0, 2);
            TLbx['uc'] = uluc.substr(3, 2);
            TLbx['ucForced'] = uluc.substr(3, 2);


            /* once TS is loaded completely, we might need to refresh the interface and prewarm the cache again in case we have some other country/language's cache present already: */
            if (!TLbx['resource-identifyer']) {
                /* console.log('Linkvertise Special: Cache-Prewarm Management in switchcountry: no need to refresh cache; nothing was loaded yet'); */
            }else {
                if (typeof(document.readyState)!='string' || document.readyState != 'complete'  || typeof (document.getElementById('TLbx_inp')) == 'undefined' || typeof (TLbxD) != 'function' || TLbxD('TLbx_sd')== null || TLbxD('TLbx_inp') == null) {
                    /* console.log('Linkvertise Special: Cache-Prewarm Management in switchcountry: delaying refresh, waiting for everything to be loaded'); */
                    setTimeout('switchcountry(\'' + uluc + '\')', 9);/* wait for DOM to be fully loaded with Thinksuggest */
                } else {

                    /* console.log('Linkvertise Special: Cache-Prewarm Management in switchcountry: Resetting cache'); */
                    TLbx['localCache'] = []; /* need to purge the cache, as it would have cached items of a wrong language/country now */
                    TLprewarmCaches();
                    TLbx['userInputLatest'] = '~';
                    TLbx_refresh();

                }
            }
        }
    </script>
</body>
</html>
